import React from "react";
import { Link } from "react-router-dom";
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Flex,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

import DarkMode from "./DarkMode";
import { MoreHorizontal } from "react-feather";

const NavBar = () => (
  <Container paddingY='2rem' position='absolute'>
    {/* <Columns> */}
      <Box spreadMobile={6} spread={4}>
        <Link to="/">
          <Heading use="h4">DAVI</Heading>
        </Link>
      </Box>

      <Box spreadMobile={6} spread={1}>
        <DarkMode />
      </Box>

      <Box spreadMobile={6} spread={1} textAlign="center">
        <button>
          <MoreHorizontal />
        </button>
      </Box>
    {/* </Columns> */}
  </Container>
);

export default NavBar;
